import Nav from "./components/nav";
import Header from "./components/welcoming/header"
import Services from "./components/welcoming/services";
import Achievements from "./components/welcoming/achievements"
import About from "./components/welcoming/about"
const App = () => {
  return (
   <>
   <section>
   <Nav />
   </section>
   <Header />
   <Services />
   <Achievements />
   <About />
   </>
  );
}

export default App;
